import React from 'react'
import { Box, BottomNavigation, BottomNavigationAction } from "@material-ui/core"
import { AddCircleSharp, DriveFileRenameOutlineRounded, ManageSearchSharp } from "@material-ui/icons"

const [value, setValue] = ['test1', 'test2']
class Item extends React.Component {


    render(){
        return (
          <Box sx={{ width: 500 }}>
            <BottomNavigation
              showLabels
              value={value}
              onChange={(event, newValue) => {
                setValue(newValue);
              }}
            >
              <BottomNavigationAction 
                label="Recents" 
                icon={<AddCircleSharpDriveFileRenameOutlineRounded />} />
              <BottomNavigationAction
                label="Favorites"
                icon={<ManageSearchSharp />}
              />
              <BottomNavigationAction
                label="Nearby"
                icon={<LocationOn />}
              />
            </BottomNavigation>
          </Box>
        );
    }
}

export default Item;
